import "../css/Loading.css";

const Loading = () => {
    const loadingBoard = Array.from({length: 20},()=>Array(10).fill(0));
    return(
        <div className="loading">
            <div className="loading-board">
                {loadingBoard.map((row,i)=>
                        {row.map((col,j)=>(
                            <div className="loading-cell" key={`${i}_${j}`}/>
                        ))}
               )}
            </div>
        </div>
    );
}

export default Loading;
